ндую, кто ищет хорошее качество по разумной цене.", "2021-02-02T23:34:31Z", "", "0", 2, 0, 5, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "183": ["Жёлтые очки потертые... Жаль, были на подарок, а так стекла реально крутые! Чёрные в комплекте", "2021-02-02T15:27:09Z", "", "0", 1, 0, 3, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "184": ["Пришли очки в немного помятой коробке , но , так как брала для себя , это не принципиально . Сбоку желтые стёкла на дужках все поцарапаны , но , я смотрю , может , это так надо ))) По-крайней мере , эти царапины на обзор вообще не влияют . А так - очки классные , все блики от фар убирает , даже ксенон , который ужасно лупит по глазам ))) Я довольна . Заценил даже ребёнок и не хотел отдавать мне обратно очки . Для поездки в темное время суток - незаменимая вещь . Спасибо производителю и магазину ! ", "2021-02-01T16:36:36Z", "", "0", 3, 0, 5, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "186": ["Купил отцу в подарок на 23 февраля. Попробовал на себе. Супер, четкость хорошая. Дарить не стыдно будет.", "2021-01-30T11:48:28Z", "", "0", 1, 0, 5, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "187": ["Все искал нормальные, действительно оригинальные очки, в итоге и эти не спасают от встречных фар тех кто не может отрегулировать фары или ксенон.", "2021-01-30T09:44:26Z", "", "0", 1, 0, 1, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "189": ["На данный момент проверял при ярком солнечном свете. Глаза не слепит, не приходится щуриться. Но улучшения зрительной картинки не наблюдается. Ожидал большего от них эффекта.", "2021-01-28T10:41:25Z", "", "0", 2, 0, 4, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "190": ["Ничем не уступают более дорогим экземплярам. Муж доволен. Спасибо.", "2021-01-28T05:48:56Z", "", "0", 5, 0, 5, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "191": ["Все целое, коробка не мятая, хорошо упаковано. Брал в подарок коллеге по работе. Очки жёлтые и черные, две штуки как в описании.", "2021-01-27T16:34:58Z", "", "0", 2, 0, 5, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "192": ["Отличные очки, мне понравились. Пришли в комплекте с черными. Со своей задачей справляются!", "2021-01-27T16:23:11Z", "", "0", 3, 0, 5, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "193": ["Ещё не проверяли в действии, но уже можно выделить плюсы и и минусы . Из плюсов: цена!! я взяла за 259 рублей. В комплекте идёт 2 пары, можно использовать в разную погоду. Из минусов: сделаны из простого пластика, не очень качественного, видно, что made in China.. отличаются от тех, что представлены на картинке. Когда начнём использовать, дополню отзыв. Соотношение цена-качество идеальное. За 259 - 400 рублей взять их стоит, дороже они , на мой взгляд, не выглядят. Ещё на пластиковой оправе был заусенец, что портит , конечно, картину. Он довольно острый, было неприятно зацепиться за него даже пальцем, что уж говорить про то, что очки мы надеваем на глаза.. За это снимаю звезду .", "2021-01-27T14:51:09Z", "", "0", 2, 0, 4, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "194": ["Очень хорошо выполняют свою функцию", "2021-01-26T16:16:10Z", "", "0", 4, 0, 5, "очки антибликовые / антибликовые очки для водителей / очки антиблик / подарок на 23 февраля", "icemosent"], "195": ["Очки понравились. Можно носить поверх других очков. При проблеме со зрением это очень удобно. Особенно для водителей.", "2021-01-26T